Abro Hilo es un lugar de encuentro y debate sobre temas que pegan fuerte en nuestras vidas, abordados desde la ciencia y la tecnología y su impacto social. Drogas, cambio climático, modelos de ciudad, inteligencia artificial y datos, sexualidad, salud mental y alimentos son algunos de los temas que se abordarán en las emisiones.

